void matrix_print(mat_t A[SIZE][SIZE])
{
	for	(size_t i = 0; i < SIZE; i++)
	{
		for	(size_t j = 0; j < SIZE; j++)
		{
			cout << A[i][j] << ", ";
		}
		cout << endl;
	}
}

